package com.gy.hsxt.gpf.gcs.bean;import com.alibaba.fastjson.JSON;/** * 省份信息 *  * @Package: com.gy.hsxt.gpf.gcs.bean * @ClassName: Province * @Description: TODO *  * @author: yangjianguo * @date: 2015-12-21 下午3:19:21 * @version V1.0 */public class Province implements java.io.Serializable {    private static final long serialVersionUID = 4256971936785590630L;    /** 省份代码 **/    private String provinceNo;    /** 国家代码 **/    private String countryNo;    /** 省份中文名 **/    private String provinceNameCn;    /** 省份名称 **/    private String provinceName;    /** 是否直辖市 **/    private long directedCity;    /** 删除标识 **/    private long delFlag;    /** 版本号 **/    private long version;    public String getProvinceNo() {        return provinceNo;    }    public void setProvinceNo(String provinceNo) {        this.provinceNo = provinceNo;    }    public String getCountryNo() {        return countryNo;    }    public void setCountryNo(String countryNo) {        this.countryNo = countryNo;    }    public String getProvinceNameCn() {        return provinceNameCn;    }    public void setProvinceNameCn(String provinceNameCn) {        this.provinceNameCn = provinceNameCn;    }    public String getProvinceName() {        return provinceName;    }    public void setProvinceName(String provinceName) {        this.provinceName = provinceName;    }    public long getDirectedCity() {        return directedCity;    }    public void setDirectedCity(long directedCity) {        this.directedCity = directedCity;    }    public long getDelFlag() {        return delFlag;    }    public void setDelFlag(long delFlag) {        this.delFlag = delFlag;    }    public long getVersion() {        return version;    }    public void setVersion(long version) {        this.version = version;    }    @Override    public String toString() {        return JSON.toJSONString(this);    }}